(1, 5, 'Kantor Pengawasan dan Pelayanan Bea dan Cukai (KPPBC) Tipe Madya Pabean C Mataram merupakan instansi vertikal Direktorat Jenderal Bea dan Cukai yang berada di bawah dan bertanggung jawab kepada Kepala Kantor Wilayah DJBC Bali, NTB dan NTT. KPPBC TMP C Mataram berlokasi di Jl. Yos Sudarso No. 14, Kecamatan Ampenan, Kota Mataram, Provinsi Nusa Tenggara Barat. Saat ini, KPPBC TMP', 'KPPBC Tipe Madya Pabean C Mataram mempunyai tugas melaksanakan pengawasan dan pelayanan di bidang kepabeanan dan cukai berdasarkan Undang-Undang Nomor 17 Tahun 2006 tentang perubahan atas Undang-Undang Nomor 10 tahun 1995 tentang Kepabeanan dan Undang-Undang Nomor 39 Tahun 2007 tentang perubahan atas Undang-Undang Nomor 11 tahun 1995 tentang Cukai. Berdasarkan KEP-31/WBC.13/KPP.MP.03/2021, KPPBC TMP C Mataram memiliki 13 janji layanan di mana keseluruhan pelayanan tersebut tidak dipungut biaya. Adapun Program Unggulan yang terdapat pada KPPBC TMP C Mataram yaitu Tim Optimalisasi Penerimaan Cukai (TOPC) dan Fasilitasi KEK Mandalika.', 'Wilayah Pengawasan KPPBC TMP C Mataram meliputi 5 (lima) wilayah administrasi di Provinsi Nusa Tenggara Barat, antara lain meliputi: 1. Kota Mataram; 2. Kabupaten Lombok Timur; 3. Kabupaten Lombok Tengah; 4. Kabupaten Lombok Barat; dan 5. Kabupaten Lombok Utara', '2023-07-24 11:09:17', '2023-07-24 11:16:06'),
(2, 8, 'KPPBC TMP C Labuan Bajo mempunyai tugas melaksanakan pengawasan dan pelayanan di bidang kepabeanan dan cukai dalam daerah wewenang kantor pengawasan dan pelayanan yang meliputi 9 (sembilan) Daerah Administrasi Pemerintahan yaitu Kabupaten Sikka, Kabupaten Ende, Kabupaten Nagekeo, Kabupaten Nada, Kabupaten Manggarai Timur, Kabupaten Manggarai, Kabupaten Manggarai Barat, Kabupaten Flores Timur, dan Kabupaten Lembata.', '-Pelayanan teknis di bidang kepabenan dan cukai;\n-Pelaksanaan pemberian perijinan dan fasilitas di bidang kepabeanan dan cukai;\n-Pelaksanaan pemungutan dan pengadministrasian bea masuk, cukai, dan pungutan negara lainnya yang dipungut oleh DJBC;\n-Pelaksanaan intelijen, patroli, penindakan, dan penyidikan di bidang kepabenanan dan cukai;\n-Penerimaan, penyimpanan, pemeliharaan dan pendistribusian dokumen kepabeanan dan cukai;\n-Pelaksanaan pengolahan data, penyajian informasi dan laporan kepabeanan dan cukai;\n-Pengelolaan dan pemeliharaan sarana operasi, sarana komunikasi, dan senjata api;\n-Pengawasan pelaksanaan tugas dan evaluasi keria; dan\n-Pelaksanaan administrasi Kantor Pengawasan dan pelayanan.', 'Kabupaten Sikka, Kabupaten Ende, Kabupaten Nagekeo, Kabupaten Ngada, Kabupaten Manggarai Timur, Kabupaten Manggarai, Kabupaten Manggarai Barat, Kabupaten Flores Timur, Kabupaten Lembata', '2023-07-24 12:05:01', '2023-07-24 12:53:47'),
(3, 7, 'Kantor Pengawasan dan Pelayanan Bea dan Cukai Tipe Madya Pabean C Kupang', 'Pelayanan dan pengawasan Impor dan Ekspor, Cukai Pabrik Minuman Mengandung Etil Alkohol (MMEA), Cukai Hasil Tembakau, Impor Sementara, Impor Sementara Kapal Wisata Asing, IMEI, Unscheduled Flight', 'Kota Kupang, Kabupaten Kupang, Kabupaten Timor Tengah Selatan, Kabupaten Rote Ndao, Kabupaten Sabu Raijua, Kabupaten Sumba Barat, Kabupaten Sumba Barat Daya, Kabupaten Sumba Tengah, Kabupaten Sumba Timur', '2023-07-24 20:37:36', '2023-09-12 16:28:36'),
(4, 6, 'Kantor Pengawasan dan Pelayanan Bea dan Cukai Tipe Madya Pabean C Sumbawa merupakan Instansi Vertikal yang berada di bawah dan bertanggung jawab kepada Kepala Kantor Wilayah DJBC Bali, Nusa Tenggara Barat dan Nusa Tenggara Timur. Jumlah pegawai KPPBC TMP C Sumbawa adalah 41 Orang ( 38 Laki-laki dan 3 Perempuan ).', 'Kegiatan pada KPPBC TMP C Sumbawa terdiri dari Pelayanan dan Pengawasan Impor dan Ekspor di luar Kawasan Pabean, Penegakan Hukum Kepabeanan dan Cukai, dan Sosialisasi terkait Kepabeanan dan Cukai.', 'Wilayah pengawasan KPPBC TMP C Sumbawa meliputi seluruh Pulau Sumbawa dengan Luas 15.414,50 km yang terdiri dari 4 Kabupaten dan 1 Kota, yaitu Kabupaten Sumbawa Barat, Kabupaten Sumbawa, Kabupaten Dompu, Kabupaten Bima dan Kota Bima', '2023-07-25 21:21:01', '2023-07-26 08:35:58'),
(5, 3, 'KPPBC TMP A Denpasar merupakan salah satu satker dibawan Kantor Wilayah DJBC Bali NTB dan NTT yang beralamat di Jalan Tukad Badung, Renon, Kec. Denpasar Selatan, Kota Denpasar, Provinsi Bali. ', 'Pelayanan dan Pengawasan di bidang Cukai meliputi :\n1. Pabrik, Penyalur, dan TPE pengusaha MMEA\n2. Pabrik HPTL\n3. Peredaran penjualan HT dan HPTL\nPelayanan dan Pengawasan di bidang Kepabeanan meliputi :\n1. Vessel Declaration\n2. Fasilitas Kawasan Berikat\n3. Fasilitas KITE IKM\n4. Pengawasan Barang Penumpang Pelabuhan', 'Wilayah pengawasan meliputi seluruh wilayah di provinsi Bali dengan pengecualian Bandara I Gusti Ngurah Rai dan Kantor Pos Renon yang terdiri dari 8 Kabupaten dan 1 Kota yakni :\n1. Kabupaten Jembrana\n2. Kabupaten Buleleng\n3. Kabupaten Tabanan\n4. Kabupaten Badung\n5. Kabupaten Gianyar\n6. Kabupaten Karangasem\n7. Kabupaten Bangli\n8. Kabupaten Klungkung\n9. Kota Denpasar\nDengan total luas wilayah mencapai 5.780 Km2\nSelain itu terdapat wilayah perairan di pulau Bali yang menjadi pengawasan KPPBC TMP A Denpasar yang terdiri dari beberapa pelabuhan besar yakni :\n1. Pelabuhan Benoa\n2. Pelabuhan Padang Bai\n3. Pelabuhan Celukan Bawang', '2023-07-27 08:24:32', '2023-07-27 08:24:32');
